import React from "react"
import ReactApexChart from "react-apexcharts"
import {
    Card,
    CardBody,
} from "reactstrap"

const scatterChart = () => {

    const series = [{
        name: "Linea de Crédito",
        data: [
            [2, 5], [7, 2], [4, 3], [5, 2], [6, 1], [1, 3], [2, 7], [8, 0], [9, 8], [6, 0], [10, 1]]
    }, {
        name: "Renovación con Cambios",
        data: [
            [15, 13], [7, 11], [5, 8], [9, 17], [11, 4], [14, 12], [13, 14], [8, 9], [4, 13], [7, 7], [5, 8], [4, 3]]
    }]

    const options = {
        chart: {
            height: 350,
            type: 'scatter',
            toolbar: {
                show: false
            },
            zoom: {
                enabled: true,
                type: 'xy'
            }
        },

        colors: ['#3b5de7', '#45cb85'],
        xaxis: {
            tickAmount: 10,

        },
        legend: {
            position: 'top',
        },
        yaxis: {
            tickAmount: 7
        }
    }

    return (
        <React.Fragment>
            <Card>
                <CardBody>
                    <h4 className="card-title mb-4">Comportamiento en el Mes</h4>

                    <ReactApexChart
                        options={options}
                        series={series}
                        height="225"
                        type="scatter"
                        className="apex-charts"
                    />

                </CardBody>
            </Card>


        </React.Fragment>
    )
}

export default scatterChart
